import React from "react";

import { Router, Route, RouteHandler } from "react-router";
import { Link } from "react-router-dom";
import logo from "../logo.png";
import "../App.css";
import "../routes/routes.js";
import { render } from "@testing-library/react";
import profile from "../logo2.png";
import Toolbar from "react-minimalist-toolbar";
import { ProgressBar, Button } from "react-bootstrap";

function homepatient() {
  var menu = [
    {
      text: "Profil korisnika",
      items: [
        {
          text: "Izloguj se",
        },
      ],
    },
  ];

  return (
    <div className="App">
      <div className="App-home">
        <Toolbar
          logo={logo}
          brand="InfoKC"
          menu={menu}
          className="toolbar"
        ></Toolbar>
        <p>Dobrodosli</p>
      </div>
      <div class="et_pb_module et_pb_code et_pb_code_2 icon-box-container et_clickable">
        <div class="et_pb_code_inner">
          <div
            class="align-middle icon-box blue-bg"
            style="background: #4cb05b;"
          >
            <div class="box-text">
              <h4>Membership</h4>
              <p style="color: #ffffff;">
                {" "}
                Our Monthly Membership offers you comprehensive primary
                healthcare coverage at affordable prices
              </p>
            </div>
            <a href="logo.png">
              <span class="h-3box-btn">Find Out More</span>
            </a>
          </div>
        </div>
      </div>
    </div>
  );
}
export default homepatient;
